import {autorun, decorate, observable, reaction} from "mobx";

class TestStore {
    loading = true;
    badge = null;

    raport = () => console.log(this.loading)
}

decorate(TestStore, {
    loading: observable,
    raport: autorun(),
    badge: observable,
});
export default TestStore;
